import "./App.css";
import { BrowserRouter} from "react-router-dom";
import { PrimeReactProvider } from "primereact/api";
import FirstPage from "./FirstPage";
function App() {
  return (

    <PrimeReactProvider>
     <div>
      <BrowserRouter>
        <FirstPage />
      </BrowserRouter>
    </div>
</PrimeReactProvider>

  );
}

export default App;
